    false,nt"url": null,nt"notes": "This report provides objectives and recommendations
    which are intended to improve the fishery resources and enhance quality fishing
    opportunities. Big Stone National Wildlife Refuge contains five primary water bodies
    that have fishery management potential, the East Pool, Minnesota River, and three
    Quarry Pits. The East Pool contains good populations of northern pike, and walleye,
    and fluctuating populations of sunfish and crappie. Bullheads and carp are abundant
    in the East Pool and techniques to reduce these populations should be undertaken.
    Access to the quarry pits has been restricted due to safety concerns; however, this
    decision is being reviewed by the Regional Safety Office. If the quarry pits are
    open to the public, they could provide additional recreational fishing opportunities.
    The upstream portion of the Minnesota River has limited access. Downstream from
    Odessa, angling pressure from bank and boat fishermen is significant during the
    spring  and fall. This report provides objectives and recommendations which are
    intended to improve the fishery resources and enhance quality fishing opportunities.",nt"owner_org":
